import Axios from 'axios';

export default class ErrorDataRequester {
    async ResolveError(id) {
        try {
            await Axios.post(`/error/${id}`);
            return true;
        }
        catch(error) {
            console.log(error);
            return false;
        }
    }

    // async updateError(precinctId, errors) {
    //     try {
    //         const res = await Axios.post(`/error/update-error/${precinctId}`, {errors: errors});
    //         return res.data;
    //     }
    //     catch(error) {
    //         console.log(error);
    //         return false;
    //     }
    // }

    async updateError(precinctId, errors) {
        try {
            const res = await Axios.post(`/error/update-error/${precinctId}`, {errors: errors});
            return res.data;
        }
        catch(error) {
            console.log(error);
            return false;
        }
    }
}
